conexaopoliticabrasil A operação da Polícia Federa (PF) deflagrada nesta quinta-feira (17) contra a Fundação Getúlio Vargas (FGV) tem potencial para criar problemas imensos para integrantes de tribunais superiores de Brasília (DF), como o Superior Tribunal de Justiça (STJ) e até mesmo o Supremo Tribunal Federal (STF). Conforme noticiado pelo Conexão Política, a força-tarefa da PF desmontou um esquema de corrupção, lavagem de dinheiro, evasão de divisas e fraude em licitações que envolveriam a instituição. De acordo com o jornalista Rodrigo Rangel, a FGV "tem laços estreitos há tempos com magistrados de Cortes superiores". Nos últimos anos, a FGV patrocinou e participou de inúmeros eventos jurídicos ligados a entidades que possuem ligações com magistrados. A Fundação Getúlio Vargas também é a responsável pela aplicação do exame da Ordem dos Advogados do Brasil (OAB) desde 2010
A quebra dos sigilos da entidade pode detalhar o caminho do dinheiro a partir dos repasses e, com isso, atingir instâncias elevadas do Judiciário brasileiro. Alvos da PF nesta quinta, diversos integrantes da família Simonsen são íntimos de importantes ministros da capital federal. Entre os assuntos que são objeto da ação policial deflagrada mais cedo está o uso da FGV para a emissão de pareceres e estudos cuja contratação servia, de acordo com a investigação, para mascarar pagamentos de propina a agentes públicos. Esta informação, assim como todos os conteúdos do Conexão Política, são publicados primeiro no nosso App de notícias, disponível para Android e iOS. Procure "Conexão Política" na sua loja de aplicativos e baixe-o agora mesmo em seu celular para receber todos os nossos materiais em primeira mão. É 100% gratuito! Ou, se preferir, acesse através do link fixado em nossa bio https:// www.conexaopolitica.com.br/aplicativo. Corre lá!
